import React from 'react';
import { Link } from "react-router-dom";
import { 
  getIdeaOne, 
  dltHold } from "../api.js";
import './modal.css';

// 子コンポーネント（モーダル）
export class JoinModal extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  modalDown = () => this.props.onClick();

  alertStatus = () => {
    const mode = this.props.content.status;
    console.log(mode);
    if(mode === 0){
      return(
        <Type_zero
          content={this.props.content}
          onClick={this.props.onClick}
        />
      )
    }
    else if(mode === 1){
      return(
        <Type_excute
          content={this.props.content}
          account={this.props.account}
          onClick={this.props.onClick}
        />
      )
    }
    else if(mode === 2){
      return(
        <Type_expire
          content={this.props.content}
          onClick={this.props.onClick}
        />
      )
    }
    else if(mode === 3){
      return(
        <Type_vote
          content={this.props.content}
          onClick={this.props.onClick}
        />
      )
    }
    else{
      console.log('mode err 478');
    }
  }

  render(){
    return(
      <>
        {this.props.showFlag ? ( // showFlagがtrueだったらModalを表示する
        <div id="overlay" className='overlay'>
          <div id="modalcontents" className="modalcontents" onClick={(event)=>{event.stopPropagation()}}>
            <this.alertStatus></this.alertStatus>
          </div>
        </div>
        ) : (
          <></>// showFlagがfalseの場合はModalは表示しない)
        )}
      </>
    );
  }
}

class Type_zero extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      title: null,
      content: this.props.content,
      account: this.props.account,
    };
  }

  componentDidMount = async() => {
    this.setState({title: await getDocuTitle(this.state.content.team_id)});
  }
  dltIdea = async() => {
    await dltHold(this.state.content.id);
  }
  modalDown = () => this.props.onClick();

  render(){
    return(
      <>
        <p>・경매 입찰 알림</p>
        <section style={{fontSize: "20px", lineHeight: "10px"}}>
          <p>문서제목: {this.state.title}</p>
          <p>현재호가: {this.props.content.tokn}</p>
        </section>
        <button onClick={this.props.onClick}>close</button>
        <button onClick={() => {
          this.dltIdea();
          this.modalDown();
        }}>알림삭제</button>
        <Link to={'/ideadetails/' + this.state.content.team_id + '/1'} style={{ textDecoration: 'none' }}>
        <button>문서로 이동</button></Link>
      </>
    )
  }
}

class Type_excute extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      title : null,
      content: this.props.content,
      account: this.props.account
    };
  }
  componentDidMount = async() => {
    this.setState({title: await getDocuTitle(this.state.content.team_id)});
  }

  excuteIdea = async() => {
    console.log(this.props.content);
    const record = {
      teamid: this.props.content.team_id,
      stake: this.props.content.reqstake,
      userid: this.props.content.user_id,
    };
  }
  dltIdea = async() => {
    await dltHold(this.state.content.id);
  }
  modalDown = () => this.props.onClick();

  render(){
    return(
      <>
        <p>・파일 열람자격 획득</p>
        <section style={{fontSize: "18px", lineHeight: "10px"}}>
          <p>경매중인 아이디어 '{this.state.title}' 의 가격을 가장 높게 제시하여 상세파일 열람자격을 획득하였습니다.</p>
          <p>문서로 이동하여 파일을 확인 후 아이디어의 낙찰을 확정하세요</p>
        </section>
        <button onClick={() => {
          this.modalDown();
        }}>confirm</button>
        <Link to={'/ideadetails/' + this.state.content.team_id + '/2'} style={{ textDecoration: 'none' }}>
        <button>문서로 이동</button></Link>
      </>
    )
  }
}

class Type_expire extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      title: null,
      content: this.props.content,
      account: this.props.account,
    };
  }
  componentDidMount = async() => {
    this.setState({title: await getDocuTitle(this.state.content.team_id)});
  }
  dltIdea = async() => {
    await dltHold(this.state.content.id);
  }
  modalDown = () => this.props.onClick();

  render(){
    return(
      <>
        <p>・프로젝트 기간 종료.</p>
        <section style={{fontSize: "20px", lineHeight: "10px"}}>
          <p>'{this.state.title}'의 프로젝트 기간이 종료되어 voting 상태로 전환되었습니다.</p>
        </section>
        <button onClick={() => {
          this.dltIdea();
          this.modalDown();
        }}>confirm</button>
        <Link to={'/ideadetails/' + this.state.content.team_id + '/0'} style={{ textDecoration: 'none' }}>
        <button>문서로 이동</button></Link>
      </>
    )
  }
}
class Type_vote extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      title: null,
      content: this.props.content,
      account: this.props.account,
    };
  }

  componentDidMount = async() => {
    this.setState({title: await getDocuTitle(this.state.content.team_id)});
  }
  modalDown = () => this.props.onClick();

  render(){
    return(
      <>
        <p>・프로젝트 종료</p>
        <section style={{fontSize: "20px", lineHeight: "10px"}}>
          <p>'{this.state.title}'의 프로젝트가 종료되었습니다.</p>
          <p>이 아이디어의 성공여부를 평가해주세요</p>
        </section>
        <button onClick={this.props.onClick}>close</button>
        <Link to={'/ideadetails/' + this.state.content.team_id + '/0'} style={{ textDecoration: 'none' }}>
        <button>문서로 이동</button></Link>
      </>
    )
  }
}
const getDocuTitle = async(_teamId) => {
  const data = await getIdeaOne(_teamId);
  return data.title;
}
